import axios from 'axios'
import { useEffect, useState } from 'react'
import './style.css'

function ListItem() {

    const [pullRequests, setPullRequests] = useState([]);

    function getPullRequests() {
        axios.get(`http://localhost:3000/webhook`)
            .then(result => {
                setPullRequests(result.data)
            })
    }
    return (
        <div className="AllPullRequests">
            {pullRequests.map(requst =>
            <div className="pullRequest">
             <span>{requst.action}</span>
             <span>{requst.number}</span>
             <span>{requst.changes}</span>
             <span>{requst.sender.id}</span>
            </div>
            )}
        </div>
    )
}

export default ListItem
